import React from 'react';
import { Link } from 'react-router-dom';
import './stylesFiles/EventBox.css';

const EventBoxInfo = ({competitionID,competitionName, type,gameType, location, startDate, link, style}) => {
    return (
        <div className="EventBoxContainer" style={style}>
            <h3><Link to={`/competition/${competitionID}`}>{competitionName}</Link></h3>
            <p className="event-location">{location}</p>
            <p className="event-type">{type} {gameType}</p>
            {startDate}
        </div>
    );
};

export default EventBoxInfo;
